  <script>
    var perfTiming = true;
    let aIV=[];
    let dIV=[];
    let sIV=[];
    function main() {
        var keys = Object.keys(ranks);
        var dec = 1;
        document.getElementById('timing_outputs').innerHTML += "Calling cmpCalcsOld()...";
        console.log("Calling cmpCalcsOld()...");
        cmpCalcsOld(ranks, keys, dec, 4096, false);
        document.getElementById('timing_outputs').innerHTML += "Calling cmpCalcsNew()...";
        console.log("Calling cmpCalcsNew()...");
        cmpCalcsNew(ranks, keys, dec);
        document.getElementById('timing_outputs').innerHTML += "Finished";
        console.log("Finished");        
    }
    function cmpCalcsNew(ranks, keys, dec) {
        var T0,i,j,k;
        if (perfTiming) {T0 = performance.now();}

        var r1atk = ranks[keys[0]][0].battle.A/1;
        //console.log("r1atk:"+r1atk);

        /* Strip out attack stats from ranks array */
        let array = [];
        for (i=0; i<ranks.numRanks && keys[i].indexOf(".")>-1; i++) {
            for (j=0; j<ranks[keys[i]].length; j++) {
                
                var currAtk = ranks[keys[i]][j].battle.A/1;
                array.push(currAtk);
                
                /* Update R1 CMP while we're here */
                if (currAtk > r1atk/1) {ranks[keys[i]][j].IVs.R1 = "W";}
                else if (currAtk < r1atk/1) {ranks[keys[i]][j].IVs.R1 = "L";}
                else {currAtk = "T";}
            }
        }
        
        /* Reduce duplicate attacks but keep counts of occurrences */
        counts = Object.values(array.reduce((a, c) => {
            (a[c] || (a[c] = {name: c, count: 0})).count += 1;
            return a;
        }, {})).sort(({count: ac}, {count: bc}) => bc - ac),
        
        /* Sort from highest attack to lowest for CMP % calculations */
        counts.sort((a,b) => b.name - a.name);
        //console.log(JSON.stringify(counts));

        /* Compute CMP win counts */
        for (i=0; i<counts.length; i++) {
            var sum = 0;
            for (j=0; j<counts.length; j++) {
                if (counts[i].name/1 > counts[j].name/1) {
                    sum += counts[j].count;
                    //console.log("counts[i("+i+")].name("+counts[i].name+":"+counts[i].count+") > ("+counts[j].name+":"+counts[j].count+")counts[j("+j+")].name, sum is now: "+sum);
                }
            }
            /* Overwrite count with sum now that we're done with this count */
            counts[i].count = sum;
        }
        //console.log(JSON.stringify(counts));

        /* Iterate one more time to update CMP win % */
        for (var i=0; i<ranks.numRanks && keys[i].indexOf(".")>-1; i++) {
            for (var j=0; j<ranks[keys[i]].length; j++) {
                for (var k=0; k<counts.length; k++) {
                    if (counts.name/1 === ranks[keys[i]][j].battle.A/1) {
                        ranks[keys[i]][j].IVs.cmp = numOut(counts.count/ranks.numRanks * 100,0);
                    }
                }
            }
        }
        
        if (perfTiming) {stopTiming(T0, "cmpCalcsNew");}
        return;
    }
    function cmpCalcsOld(ranks, keys, dec, checkLimit, filterMod) {
        var T0;
        if (perfTiming) {T0 = performance.now();}
        var i=0,j=0,k=0,monProcessed=0;
        /*console.log("cmpCalcs: received ranks:"+ranks+", first key:"+keys.slice(0, 1)+", dec:"+dec+", cmpLim:"+cmpLim+", filterMod:"+filterMod);*/
        
        /* Clone user IVs so that we can destructively search for them */
        var aIVtmp = aIV.slice(0);
        var dIVtmp = dIV.slice(0);
        var sIVtmp = sIV.slice(0);
        var foundUserIV = false;
        
        /* Just process up to user's cmpLim for performance efficiency */
        /* keys[i].indexOf(".")>-1 checks that this entry exists */
        for (i=0; i<ranks.numRanks && keys[i].indexOf(".")>-1 && (aIVtmp.length>0 || monProcessed<checkLimit); i++) {
          for (j=0; j<ranks[keys[i]].length; j++) {
            if (filterMod) {
              /* Check that this row will actually be output if user has set any filters, unless this is a user IV */
              if (!(mA/1 <= numOut(ranks[keys[i]][j].battle.A,dec) && mD/1 <= numOut(ranks[keys[i]][j].battle.D,dec) && mHP/1 <= ranks[keys[i]][j].battle.S)) {
                /* This IV is below user filters and will not be displayed unless it is a user IV. Need to check all user IVs to see if we still need to compute CMP... */
                for (k=0,foundUserIV=false; k<aIVtmp.length;k++) {
                  /* Need to iterate through all user IVs to check if this is a user IV before skipping it */
                  if (ranks[keys[i]][j].IVs.A/1 === aIVtmp[k] && ranks[keys[i]][j].IVs.D/1 === dIVtmp[k] && ranks[keys[i]][j].IVs.S/1 === sIVtmp[k]) {
                    foundUserIV = true;
                    break;
                  }
                }
                if (!(foundUserIV)) {
                  /* Skip if this wasn't a user IV */
                  continue;
                } else {
                  /* Pad checkLimit to account for "hidden" user IV that needs to be processed */
                  checkLimit++;
                }
              }
            }
            /* Now that we have validated that this IV needs a CMP calculation, go ahead and compute it */
            computeSingleIV_CMP(ranks, ranks[keys[i]][j], checkLimit, keys, dec);
            
            /* Check if this was a user IV, if it was, remove from array of user IVs to process */
            for (k=0; k<aIVtmp.length;k++) {
              if (ranks[keys[i]][j].IVs.A/1 === aIVtmp[k] && ranks[keys[i]][j].IVs.D/1 === dIVtmp[k] && ranks[keys[i]][j].IVs.S/1 === sIVtmp[k]) {
                /* Successfully processed CMP for this user IV, remove from arrays so we don't keep searching for it */
                aIVtmp.splice(k,1); dIVtmp.splice(k,1); sIVtmp.splice(k,1);
                break;
              }
            }
          } /* Keep track of actual number of mon processed (for tie breaking double loop logic) */
          monProcessed++;
        }
        
        if (perfTiming) {stopTiming(T0, "cmpCalcsOld");}
        return ranks;
      }
      function numOut(num, decimals) {
        if (isNaN(decimals/1)) {
          console.error("numOut: unsupported decimal place:"+JSON.stringify(decimals));
          return false;
        }
        
        var places = Math.pow(10,decimals);
        var out = (Math.trunc(num*places)/places).toFixed(decimals);
        return out;
      }
      function computeSingleIV_CMP(ranks, chkIVs, cmpLim, keys, dec) {
        
        /* Compare chkIVs all remaining IVs up to requested cmpLim */
        for (var i=0,iters=1; (iters<cmpLim/1 && iters<ranks.numRanks && keys[i].indexOf(".")>-1); i++) {
          for (var j=0; ((j<ranks[keys[i]].length) && (iters<cmpLim/1)); j++, iters++) {
            
            /* Rank 1 CMP Processing */
            if (i === 0 && j === 0) {
              var r1atk = numOut(ranks[keys[i]][j].battle.A,dec)/1;
              
              if (numOut(chkIVs.battle.A,dec)/1 > r1atk) {
                /*console.log("R1 set to W because numOut(chkIVs.battle.A,1):"+numOut(chkIVs.battle.A,1)+" > r1atk: "+r1atk);*/
                chkIVs.IVs.R1 = "W";
                chkIVs.IVs.cmp=1;
              } else if (numOut(chkIVs.battle.A,dec)/1 < r1atk) {
                /*console.log("R1 set to L because numOut(chkIVs.battle.A,1):"+numOut(chkIVs.battle.A,1)+" < r1atk: "+r1atk);*/
                chkIVs.IVs.R1 = "L";
                chkIVs.IVs.cmp=0;
              } else {
                /*console.log("R1 set to T because numOut(chkIVs.battle.A,1):"+numOut(chkIVs.battle.A,1)+" = r1atk: "+r1atk);*/
                chkIVs.IVs.R1 = "T";
                chkIVs.IVs.cmp=0;
              }
            } else {
              /* Process CMP for all other IVs */
              if (numOut(chkIVs.battle.A,dec)/1 > numOut(ranks[keys[i]][j].battle.A,dec)/1) {
                chkIVs.IVs.cmp+=1;
              }
            }
          }
        }
        
        /* Ensure we convert count of CMP wins to percentage */
        chkIVs.IVs.cmp = numOut(chkIVs.IVs.cmp/cmpLim * 100,0);
        return;
      }
